import React from 'react';
import Header from '../components/Header';

const HomePage = () => {
    return (
        <div>
            <Header />
            <h2>Добро пожаловать на сайт знакомств!</h2>
            {/* Дополнительно сюда можно будет добавить список карточек пользователей, фильтры и другие элементы */}
        </div>
    );
};

export default HomePage;
